var $bm_rt;
var totalW, numPts, gaps, d, y, tanD, pts, inTan, outTan, startPt, i, ptX, ptY, i, ptX, ptY, ptY, i, ptX, ptY;
totalW = effect('Snake Path')('Total Width');
numPts = effect('Snake Path')('Number of Points');
gaps = $bm_div(totalW, numPts);
d = $bm_mul(thisComp.frameDuration, effect('Snake Path')('Frame Delay'));
y = effect('Snake Path')('First Point Y Value');
tanD = $bm_div($bm_mul(gaps, effect('Snake Path')('Stair-Step Look')), 100);
pts = new Array();
inTan = new Array();
outTan = new Array();
startPt = effect('Snake Path')('Direction');
if (startPt == 1) {
    for (i = 0; i <= numPts; i++) {
        ptX = $bm_mul(i, gaps);
        ptY = y.valueAtTime($bm_sub(time, $bm_mul(d, i)));
        pts.push([
            ptX,
            ptY
        ]);
        inTan.push([
            $bm_neg(tanD),
            0
        ]);
        outTan.push([
            tanD,
            0
        ]);
    }
} else if (startPt == 2) {
    for (i = 0; i <= numPts; i++) {
        ptX = $bm_mul(i, gaps);
        if (i < $bm_div(numPts, 2)) {
            ptY = y.valueAtTime($bm_sub(time, $bm_mul(d, $bm_sub($bm_div(numPts, 2), i))));
        } else {
            ptY = y.valueAtTime($bm_sub(time, $bm_mul(d, $bm_sub(i, $bm_div(numPts, 2)))));
        }
        pts.push([
            ptX,
            ptY
        ]);
        inTan.push([
            $bm_neg(tanD),
            0
        ]);
        outTan.push([
            tanD,
            0
        ]);
    }
} else {
    for (i = 0; i <= numPts; i++) {
        ptX = $bm_mul($bm_sub(numPts, i), gaps);
        ptY = y.valueAtTime($bm_sub(time, $bm_mul(d, i)));
        pts.push([
            ptX,
            ptY
        ]);
        inTan.push([
            $bm_neg(tanD),
            0
        ]);
        outTan.push([
            tanD,
            0
        ]);
    }
}
$bm_rt = createPath(pts, inTan, outTan, false);

